import React from 'react';
import "./InformationBox.css";
import {
    Card,
    CardContent,
    Typography
} from "@material-ui/core"
function InformationBox({title, cases, total,active, isRed, ...props }) {
    return (
        <Card
            onClick={props.onClick}
            className={`informationBox ${active && "informationBox-selected"} ${
                isRed && "informationBox-red"
            }`}
            >
            <CardContent>
                <Typography color="textSecondary" gutterBottom>
                {title}
                </Typography>
                <h2 className={`informationBox_cases ${!isRed && "informationBox_cases-green"}`}>
                {cases}
                </h2>

                <Typography className="informationBox_total" color="textSecondary">
                {total} Total
                </Typography>
            </CardContent>
        </Card>

    )
}

export default InformationBox
